import { LetterAnimation, Transition } from "../comps/Portal";
import React, { useEffect, useState } from "react";
import { TypeAnimation } from "react-type-animation";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <Transition>
      <div className="contain">
        <div>
          <h1>
            <TypeAnimation
              sequence={"Hello there!"}
              wrapper="p"
              speed={50}
              repeat={0}
            />
            <TypeAnimation
              sequence={"I'm D"}
              wrapper="p"
              speed={50}
              delay={2000} // adjust the delay to match the duration of the first animation
              repeat={0}
            />
            <TypeAnimation
              sequence={"who you lookin' for."}
              wrapper="p"
              speed={50}
              delay={4000} // adjust the delay to match the duration of the first and second animations
              repeat={0}
            />
          </h1>
          <h2 className="cursor-default tracking-[0.5em] text-slate-400 text-xs my-5">
            <span className="transition-all hover:shadow hover:text-slate-50">
              Front End Developer
            </span>{" "}
            /{" "}
            <span className="transition-all hover:shadow hover:text-slate-50">
              Freelancer
            </span>
          </h2>
          <div className="mt-12">
            <Link to="/contact" className="button">
              Say Hello <i className="fa-regular fa-hand-wave"></i>
            </Link>
          </div>
        </div>
      </div>
    </Transition>
  );
};

export default Home;
